import axios from "axios";

// const api = axios.create({
//   baseURL: "http://118.67.134.151/hackathon/api",
// });

export const auth = (data) => {
  axios
    .post("/auth", data)
    .then((res) => {
      console.log("res : ", res);
    })
    .catch((e) => {
      console.error("Error : ", e);
    });
};
